import React from "react";
import './nav.css';

function Nav () {
    return (
        <nav>
            <ul>
                <li><a href="#"  className = "home-fa"><i class="fa-solid fa-house"></i><span>Home</span></a></li>
                <li><a href="#"  className = "about-fa"><i class="fa-solid fa-user"></i><span>About</span></a></li>
                <li><a href="#"  className = "skills-fa"><span>Skills</span></a></li>
                <li><a href="#"  className = "projects-fa"><span>Projects</span></a></li>
                <li><a href="#"  className = "contact-fa"><span>Contact</span></a></li>
            </ul>
        </nav>
    );
}

export default Nav;
